import ListGroup from 'react-bootstrap/ListGroup';

function FAQList() {
    return (
        <div>
            <div>
                <h2 style={{ textAlign: 'center' }}>Частые вопросы</h2>
            </div>
            <ul style={{ marginLef: '10px' }}>
                <li><a href='/'>Открыт ли монастырь для посещений?</a></li>
                <li><a href='/'>Как добраться до монастыря?</a></li>
                <li><a href='/'>Работает ли трапезная?</a></li>
                <li><a href='/'>Есть ли безналичный расчет?</a></li>
                <li><a href='/'>Проводится ли у нас таинство крещения?</a></li>
                <li><a href='/'>Как заказать поминовение?</a></li>
                <li><a href='/'>Можно ли переночевать в монастыре?</a></li>
            </ul>
        </div>
    );
}

export default FAQList;
